import React, { Component } from "react";

class SignedIn extends Component {
  state = {
    profilePic: []
  };
  render() {
    return (
      <header>
        <nav className="container">
          <img class="logo" src="images/logo.png" alt=" raba logo" />
          <ul class="navlinks">
            <li>Overview</li>
            <li>Analytics</li>
            <li>Catalog</li>
            <li>Pricing</li>
            <li>Transactions</li>
          </ul>
          <div className="rightnav">
            <input type="button" align="right"></input>
          </div>
        </nav>
      </header>
    );
  }
}

export default SignedIn;
